@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
 

  cambiaVisibilita(){
    this.visibile = !this.visibile;
  }

  utente = {
    nome: 'Robert',
    cognome: 'Neagu'
  }
}


